    isVerified: true,
    view : '100k',
    time: '1 month ago',
  }

  return (
    <div className='container'>
    <Video {...obj}></Video>
    <Video 
    title={'react full tutorial'}
    channelName={'islam makhachev'}
    isVerified= {false}
